
$(function(){var b=document.querySelector(".toggle-type");var a=new Switchery(b,{color:"#283133",secondaryColor:"#283133"});var d=document.querySelector(".toggle-position");var c=new Switchery(d,{color:"#283133",secondaryColor:"#283133"});b.onchange=function(){if(b.checked){c.disable();$("body").children(".navbar").addClass("navbar-fixed-top");$("body").addClass("navbar-top")}else{c.enable();$("body").children(".navbar").removeClass("navbar-fixed-top");$("body").removeClass("navbar-top")}};d.onchange=function(){if(d.checked){a.disable();$("body").children(".navbar").addClass("navbar-fixed-bottom");$("body").addClass("navbar-bottom")}else{a.enable();$("body").children(".navbar").removeClass("navbar-fixed-bottom");$("body").removeClass("navbar-bottom")}}});